import React, { Component } from 'react';


class Section extends Component {

    render() {
        return (<div>
            <h2>{ this.props.title }</h2>
            { this.props.children }
            <a href={ this.props.link }>
                <Button variant="outlined">{ this.props.more }</Button>
            </a>
        </div>);
    }
}
export default Section;
